import Form from 'react-bootstrap/Form';

function FormCheck() {
    return (
        <Form>
            <div key={`reverse-${type}`} className="mb-3">
                <Form.Check
                    reverse
                    label="1"
                    name="group1"
                    type={type}
                    id={`reverse-${type}-1`}
                />
                <Form.Check
                    reverse
                    label="2"
                    name="group1"
                    type={type}
                    id={`reverse-${type}-2`}
                />
                <Form.Check
                    reverse
                    disabled
                    label="3 (disabled)"
                    type={type}
                    id={`reverse-${type}-3`}
                />
            </div>
        </Form>
    );
}

export default FormCheck;
